import axios from "axios";
//const ROOT_API = `process.env.ROOT_API`

export const fetchTreeData = async () => {
  try {
    //const path = ROOT_API`/devops`;
    const result = await axios.get('http://my-host/devops');
    return result.data;
  } catch (error) {}
};
